import React from 'react';
import DataTable from '../components/DataTable';
import Axios from "axios";

export const columns = [
    {
      Header: "Receiver",
      accessor: "name",
    },
    {
      Header: "Weight",
      accessor: "weight",
    },
    {
      Header: "Box Colour",
      accessor: "color",
      Cell: row => {
        row.styles['backgroundColor'] = row.value;
        return "";
      }
    },
    {
      Header: "Shipping cost",
      accessor: "cost",
    }
  ];
  export const data = getBoxes.map((element) => {
    return {
      id: element.id,
      name: element.name,
      weight: element.weight,
      color: element.color,
      cost: element.country
    };
  });


  const getBoxes = () => {
    Axios.get("http://localhost:30010/employees").then((response) => {
      return response.data;
    });
  };
export class ListBoxes extends React.Component {
    render() {
        return (
            <DataTable 
            columns = {columns}
            data = {data}
            />
        )
    }
}
export default ListBoxes;
